&lt;p&gt;
Series MQM is a lateral load resisting, low friction, compact cylinder for low to high speeds. The metal seal construction with low operating resistance allows actuation in speed and output control ranges that are impossible for ordinary cylinders. The MQM offers long life expectancy of 10,000km or 100 million full cycles.
&lt;/p&gt;

